import Vue from 'vue';
import Router from 'vue-router';
import CreatePage from './views/CreatePage.vue'; 

Vue.use(Router);

export default new Router({
    mode: 'history',
  routes: [
    {
      path: '/create',
      name: 'Create',
      component: CreatePage, 
    },
  ],
});
